import React from 'react';
import { Link } from 'react-router-dom';
import './NotFound.css'
const NotFound = () => {
    return (
        <div className="notFound">
            <Link to="/home"><button className="btn btn-lg bg-primary">Go to home</button></Link>
        </div>
    );
};

export default NotFound;
